import React from 'react';
import firebase from 'firebase';
import { Button, Div, Input, Card, CardGrid, Text, Separator } from '@vkontakte/vkui';
import '@vkontakte/vkui/dist/vkui.css';

function TestFeed() {
    const [skins, setSkins] = React.useState([])

    React.useEffect(() => {
        const fetchData = async () => {
            const db = firebase.firestore()
            const data = await db.collection("skins").get()
            setSkins(data.docs.map(doc => doc.data()))
        }
        fetchData()
    }, [])

    return (
     //   <Div>
     <React.Fragment> 
            <Button>     
          {skins.map(skin => (
    <Text style={{ fontSize: 25, textAlign: 'left' }} key={skin.category} key={skin.player_id} key={skin.nickname}>Предложил: {skin.nickname} <br/>
    ID игрока: {skin.player_id} <br/>Категория: {skin.category} </Text>
        ))} </Button>
        </React.Fragment>
    );
}

function Nickname() {
    const [skins, setSkins] = React.useState([])

    React.useEffect(() => {
        const fetchData = async () => {
            const db = firebase.firestore()
            const data = await db.collection("skins").get()
            setSkins(data.docs.map(doc => doc.data()))
        }
        fetchData()
    }, [])
    
    return  
        {skins.map(skin => (
     <Text style={{ fontSize: 25, textAlign: 'left' }} key={skin.nickname}>Категория: {skin.nickname} </Text>))}
    
}

function PlayerID() {
    const [skins, setSkins] = React.useState([])

    React.useEffect(() => {
        const fetchData = async () => {
            const db = firebase.firestore()
            const data = await db.collection("skins").get()
            setSkins(data.docs.map(doc => doc.data()))
        }
        fetchData()
    }, [])
    
    return  
        {skins.map(skin => (
     <Text style={{ fontSize: 25, textAlign: 'left' }} key={skin.player_id}>Категория: {skin.player_id} </Text>))}
    
}

function Category() {
    const [skins, setSkins] = React.useState([])

    React.useEffect(() => {
        const fetchData = async () => {
            const db = firebase.firestore()
            const data = await db.collection("skins").get()
            setSkins(data.docs.map(doc => doc.data()))
        }
        fetchData()
    }, [])
    
    return  
        {skins.map(skin => (
     <Text style={{ fontSize: 25, textAlign: 'left' }} key={skin.category}>Категория: {skin.category} </Text>))}
    
}

export default TestFeed;
